import React, { Component } from "react";

class HeaderNav extends Component {
    state={
        links:["History", "Skillset", "Interests", "Projects", "Future Projects"]
    }

    render() {
      return (
        <div className = "flex-row header-nav">
            {/* <a className = "nav-link history" href="#">History</a>
            <a className = "nav-link skillset" href="#">Skillset</a>
            <a className = "nav-link interests" href="#">Interests</a>
            <a className = "nav-link projects" href="#">Projects</a>
            <a className = "nav-link future-projects" href="#">Future Projects</a> */}
            {this.state.links.map(linkName=>(<a className = {`nav-link ${linkName.toLowerCase().replace(/\s/, "-")}`} href="#">{linkName}</a>))}
        </div>
      );
    }
  }
  export default HeaderNav;
